(1, 'home', '{\"hero_title\":\"Where Dark Defines Focus and Bright Creates Impact.\",\"hero_subtitle\":\"Dark and Bright menghadirkan pendekatan desain modern yang mengutamakan identitas, konsistensi, dan pengalaman pengguna. Melalui kontras visual yang terkontrol, kami membangun website dan sistem brand yang kuat, relevan, dan berkelanjutan.\",\"cta1_label\":\"Start Your Project\",\"cta1_link\":null,\"cta2_label\":\"Explore Our Services\",\"cta2_link\":null,\"projects_count\":\"500K+\",\"designers_count\":\"1K+\",\"satisfaction_percent\":\"98%\",\"services\":[{\"title\":\"Desain Logo\",\"subtitle\":\"Build identity through clarity.\",\"description\":\"Identitas visual yang kuat dimulai dari logo yang tepat. Kami merancang logo yang merepresentasikan karakter brand Anda secara tegas, modern, dan mudah dikenali, dengan keseimbangan estetika dan makna yang berkelanjutan.\",\"paket\":\"desain-logo\",\"image\":\"\\/storage\\/pages\\/vtcuRPpDz3M9V0Vwlg4itfgsSWwYM7b3uZOSDZum.png\"},{\"title\":\"Design Stationery\",\"subtitle\":\"Consistency that speaks professionalism.\",\"description\":\"Stationery bukan sekadar pelengkap, melainkan perpanjangan identitas brand. Setiap elemen dirancang konsisten, rapi, dan profesional untuk memperkuat kesan brand dalam setiap interaksi bisnis.\",\"paket\":\"design-stationery\",\"image\":\"\\/storage\\/pages\\/7i5Xljovl23bpMIo8A8D4LAl3M17AK9IhUE5JwJ3.png\"},{\"title\":\"Website Design\",\"subtitle\":\"Design with purpose. Experience with impact.\",\"description\":\"Website yang dirancang dengan pendekatan modern, fokus pada pengalaman pengguna, dan visual kontras khas Dark and Bright. Menghadirkan tampilan yang bersih, responsif, dan berkarakter kuat untuk kebutuhan digital Anda.\",\"paket\":\"website-design\",\"image\":\"\\/storage\\/pages\\/Af0XtqLNPHndR48XAtuo8IF8RH9VYPQjdTlAFLUz.png\"},{\"title\":\"Kemasan Design\",\"subtitle\":\"Packaging that defines your product.\",\"description\":\"Desain kemasan yang menarik secara visual dan kuat secara identitas, dirancang untuk meningkatkan nilai produk sekaligus menciptakan daya tarik yang menonjol di pasar.\",\"paket\":\"kemasan-design\",\"image\":\"\\/storage\\/pages\\/zA4d4mreufruIY65x2iHAegdbm6hGDoPxsANFmuh.png\"},{\"title\":\"Feeds Design\",\"subtitle\":\"Visual consistency for digital presence.\",\"description\":\"Konten visual media sosial yang konsisten, estetis, dan selaras dengan identitas brand. Dirancang untuk meningkatkan engagement sekaligus membangun citra profesional secara berkelanjutan.\",\"paket\":\"feeds-design\",\"image\":\"\\/storage\\/pages\\/P0G9mI5peNPZk3x7nmuBBRJejbZhJRK7onHdJN63.png\"},{\"title\":\"Design Lainnya\",\"subtitle\":\"Custom design. One strong identity.\",\"description\":\"Solusi desain fleksibel untuk berbagai kebutuhan visual Anda. Dari konsep hingga eksekusi, setiap desain dibuat dengan pendekatan profesional dan identitas yang tetap terjaga.\",\"paket\":\"design-lainnya\",\"image\":\"\\/storage\\/pages\\/UIxkG3SVakef93O7aur7HVLhD4FJFUIYwaa2snbm.png\"}],\"templates\":[{\"name\":\"Business Card Templates\",\"price\":\"Rp 25K\",\"link\":\"#\",\"image\":\"\\/storage\\/pages\\/gLYMdkMxSfS4aH6PTU0Vcj5UJgztddqXuwUIqPbS.png\"},{\"name\":\"Instagram Story Pack\",\"price\":\"Gratis\",\"link\":\"#\",\"image\":\"\\/storage\\/pages\\/BKQ39QNO52wCot7M5ZaAZrqX8XXEiOmhzEalp9ai.png\"},{\"name\":\"Presentation Template\",\"price\":\"Rp 75K\",\"link\":\"#\",\"image\":\"\\/storage\\/pages\\/XEMd3G8lHbNoEu5ecSg7IMBVhQDRZL7f3EWGA5WO.png\"},{\"name\":\"Brochure Template\",\"price\":\"Rp 35K\",\"link\":\"#\",\"image\":\"\\/storage\\/pages\\/bXGCauvd01euUSiWg3hdPOkYNd8uObIpIMkch2XH.png\"}],\"top_designers\":[{\"name\":\"Ganang Jaya\",\"role\":\"Logo & Brand Identity\",\"description\":\"Sarah berfokus pada perancangan identitas visual yang kuat dan bermakna. Ia menggabungkan riset brand, tipografi, dan komposisi visual untuk menciptakan logo yang tidak hanya menarik secara estetika, tetapi juga mampu merepresentasikan karakter dan nilai brand secara konsisten di berbagai media.\",\"image\":\"\\/storage\\/pages\\/uYBWiwk1R2XCCO9UMb9jN4GyymSMXXoqiKy6ICgW.png\"},{\"name\":\"Andi Rahman\",\"role\":\"UI\\/UX Designer\",\"description\":\"Andi adalah UI\\/UX Designer yang mengutamakan pengalaman pengguna dan kejelasan interaksi. Setiap desain yang ia buat berangkat dari kebutuhan pengguna, dikemas dengan visual modern, struktur yang rapi, serta alur yang intuitif untuk menghasilkan produk digital yang efektif dan mudah digunakan.\",\"image\":\"\\/storage\\/pages\\/UGQigDVKEyZilzybAQMqt2J5SElLGlgJVYdnxmhR.png\"},{\"name\":\"Maya Sari\",\"role\":\"Social Media Design\",\"description\":\"Maya spesialis dalam menciptakan konten visual media sosial yang konsisten dan engaging. Ia memahami ritme platform digital dan mengubah identitas brand menjadi desain feed yang menarik, relevan, serta mampu meningkatkan interaksi dan kehadiran brand secara berkelanjutan.\",\"image\":\"\\/storage\\/pages\\/DKKaXcoyyUeGp0DrMCFCZ1IyDJ9yg8BeKrTfD5xC.png\"},{\"name\":\"Budi Santoso\",\"role\":\"Print Design\",\"description\":\"Budi berpengalaman dalam desain cetak dengan perhatian tinggi pada detail, tata letak, dan kualitas visual. Ia memastikan setiap materi cetak\\u2014mulai dari brosur hingga kemasan\\u2014memiliki tampilan profesional, jelas, dan selaras dengan identitas brand yang dibangun.\",\"image\":\"\\/storage\\/pages\\/xxf7uV7VHqypfyAcsTDVvm98qumzIW3AP4nfnhdS.png\"}],\"hero_image\":\"\\/storage\\/pages\\/iLTWq9OTtJBOYN15rCsgd4nGVA2HbuXY4sZjWNGr.png\"}', '2025-12-17 02:10:07', '2025-12-23 16:58:16'),
(2, 'layanan', '{\"services\":[{\"title\":\"Desain Logo\",\"subtitle\":\"Strong Identity Starts Here\",\"paket\":\"desain-logo\",\"image\":\"\\/storage\\/pages\\/U8aw6hCzL7Mi5qhJn3bEMUmHGjj7uTQFi9l0UHiu.png\"},{\"title\":\"Design Stationery\",\"subtitle\":\"Consistent Brand in Every Detail\",\"paket\":\"design-stationery\",\"image\":\"\\/storage\\/pages\\/AxVYlFLp2WmNkPF7GqyzG5mtMJdSbRjL1SdqGd6M.png\"},{\"title\":\"Website Design\",\"subtitle\":\"Modern UI. Clear Experience.\",\"paket\":\"website-design\",\"image\":\"\\/storage\\/pages\\/YqyumLsnfYQgmvNkxf3eNlzPFQ3NPLSwhjK8g8gC.png\"},{\"title\":\"Kemasan Design\",\"subtitle\":\"Packaging That Sells Visually\",\"paket\":\"kemasan-design\",\"image\":\"\\/storage\\/pages\\/EqWsbyrLBk3pAMJdgdrSe4jD7UGtX4Olkd9UZjdw.png\"},{\"title\":\"Feeds Design\",\"subtitle\":\"Visual Consistency for Social Media\",\"paket\":\"feeds-design\",\"image\":\"\\/storage\\/pages\\/DZDcUlPhuj0JNPsyuLS0p2t8OEXAoKs8U6kU2sMQ.png\"},{\"title\":\"Design Lainnya\",\"subtitle\":\"Custom Design Solutions\",\"paket\":\"design-lainnya\",\"image\":\"\\/storage\\/pages\\/DYCSireUJ0t0qBydQO3IAuEljqTsIqifSscezxoT.png\"}],\"hero_title\":\"Layanan Desain Profesional\",\"hero_subtitle\":\"Kami membantu brand Anda tampil menonjol \\u2014 dari kemasan, konten feed, hingga desain custom. Pilih layanan, konsultasi, dan terima hasil yang siap pakai.\",\"cta1_label\":\"Lihat Layanan\",\"cta1_link\":\"#services\",\"cta2_label\":\"Konsultasi\",\"cta2_link\":\"https:\\/\\/wa.me\\/6281234567890\",\"hero_image\":\"\\/storage\\/pages\\/GVQx7cQMoTMkBAkFJrTw8epw0b3mFssbPMvHEWGk.png\"}', '2025-12-17 08:00:28', '2025-12-24 09:24:04'),
(3, 'portfolio', '{\"logo\":[{\"title\":\"Visionary\",\"caption\":\"Modern \\u00b7 Futuristic \\u00b7 Forward Thinking\",\"description\":\"Logo ini merepresentasikan visi dan arah masa depan dengan bentuk geometris sederhana dan tegas. Desain minimalis dipadukan dengan kesan futuristik untuk mencerminkan brand yang inovatif, percaya diri, dan siap berkembang di era digital.\",\"image\":\"\\/storage\\/pages\\/bypnuspP9M8vNwTuse65KMojgpuANem8lFWpArSN.png\"},{\"title\":\"Nexus\",\"caption\":\"Connectivity \\u00b7 Precision \\u00b7 Technology\",\"description\":\"Nexus mengangkat konsep keterhubungan dan keseimbangan melalui bentuk simetris dan garis yang presisi. Logo ini dirancang untuk brand yang mengutamakan kolaborasi, sistem yang kuat, serta identitas profesional dan modern.\",\"image\":\"\\/storage\\/pages\\/DsYbNzOvVZm3Kr1RoBPEWn5JvX2f1vDbtXJ7jmja.png\"},{\"title\":\"Zenith\",\"caption\":\"Excellence \\u00b7 Elegance \\u00b7 Growth\",\"description\":\"Zenith melambangkan pencapaian tertinggi dan kualitas unggul. Desain logo yang dinamis dan elegan menciptakan kesan premium, stabil, dan berorientasi pada pertumbuhan jangka panjang.\",\"image\":\"\\/storage\\/pages\\/oK1OV8xhoc4sn7bwdzMyS6uIrgnIIDfdZGJMmiVO.png\"}],\"stationery\":[{\"title\":\"Corporate\",\"caption\":\"Corporate Identity Stationery\",\"description\":\"Stationery ini dirancang dengan pendekatan modern dan profesional, menonjolkan konsistensi identitas brand melalui komposisi warna gelap yang elegan dan aksen terang yang tegas. Setiap elemen\\u2014mulai dari kartu nama hingga kop surat\\u2014dibuat rapi, bersih, dan fungsional untuk memperkuat citra brand di setiap interaksi bisnis.\",\"image\":\"\\/storage\\/pages\\/zMzuDDqHyGpBSZBV1DL5RNQmduCoJl2OKNjMUH2c.png\"},{\"title\":\"Modern\",\"caption\":\"Minimal Modern Stationery\",\"description\":\"Mengusung gaya minimalis dengan keseimbangan antara ruang gelap dan highlight terang, desain ini fokus pada keterbacaan dan kesan eksklusif. Visual yang sederhana namun presisi menjadikan stationery sebagai representasi brand yang kuat, modern, dan relevan di era digital.\",\"image\":\"\\/storage\\/pages\\/DmN11Gsn5J1zTOz4xHWSvYYENxiuGPuGDp7fuN9q.png\"},{\"title\":\"Creative\",\"caption\":\"Creative Brand Stationery\",\"description\":\"Stationery ini menggabungkan sisi kreatif dan profesional dalam satu kesatuan visual. Konsep dark base dipadukan dengan elemen bright sebagai focal point, menciptakan identitas yang berani, dinamis, dan mudah dikenali tanpa mengorbankan kesan formal.\",\"image\":\"\\/storage\\/pages\\/ysLglMhjgiUO0RD0Hg0jashSPbawcQzt6u67Qvba.png\"}],\"website\":[{\"title\":\"Clean Corporate Website\",\"caption\":\"Clean Corporate Website\",\"description\":\"Website dengan tampilan bersih dan profesional yang dirancang untuk membangun kepercayaan serta kredibilitas brand. Struktur layout yang rapi, tipografi jelas, dan visual yang seimbang memastikan pesan bisnis tersampaikan secara efektif.\",\"image\":\"\\/storage\\/pages\\/60804g1ZIuXwdOuw1fsjaQDUufcvUJ9AUxy5th3N.png\"},{\"title\":\"Modern Tech Website\",\"caption\":\"Modern Tech Website\",\"description\":\"Desain website berkonsep teknologi modern dengan visual futuristik dan interaksi dinamis. Mengutamakan performa, inovasi, dan user experience untuk brand digital yang ingin tampil progresif dan relevan.\",\"image\":\"\\/storage\\/pages\\/RwYDJkN2SfPRHQl72L5oG2WmdnqiHzIvMAOlz0Ye.png\"},{\"title\":\"Creative Portfolio Website\",\"caption\":\"Creative Portfolio Website\",\"description\":\"Website portfolio dengan pendekatan visual yang berani dan artistik. Memadukan elemen gelap dan terang untuk menonjolkan karya, menciptakan pengalaman eksplorasi yang kuat dan berkesan.\",\"image\":\"\\/storage\\/pages\\/EJEPmkXPal8vd0TqmQeC2DodnIIUBeeSU3ZgatSd.png\"}],\"packaging\":[{\"title\":\"Modern Product Packaging\",\"caption\":\"Modern Product Packaging\",\"description\":\"Desain kemasan dengan pendekatan modern dan bersih yang menonjolkan identitas produk secara jelas. Komposisi warna gelap dipadukan dengan aksen terang untuk menciptakan kesan profesional, premium, dan mudah dikenali di rak penjualan.\",\"image\":\"\\/storage\\/pages\\/sJLaFNLTB0fpW5RIe8UVPiZZF05v3sDmK3dZCsV2.png\"},{\"title\":\"Minimal Premium Packaging\",\"caption\":\"Minimal Premium Packaging\",\"description\":\"Kemasan minimalis dengan fokus pada kesederhanaan, keterbacaan, dan estetika eksklusif. Setiap elemen visual dirancang presisi untuk memperkuat nilai produk dan menghadirkan kesan elegan tanpa berlebihan.\",\"image\":\"\\/storage\\/pages\\/SQY45m0EErgWdqOMC70XN62hWS52LhJit08grj5o.png\"},{\"title\":\"Creative Brand Packaging\",\"caption\":\"Creative Brand Packaging\",\"description\":\"Desain kemasan kreatif yang menggabungkan karakter brand dan daya tarik visual. Konsep dark base dengan highlight bright digunakan sebagai focal point untuk menciptakan kemasan yang berani, dinamis, dan mudah diingat.\",\"image\":\"\\/storage\\/pages\\/gRCBorkd4TT13cZnaF06qxgvNMdCWr2nU1IKTlbP.png\"}],\"feeds\":[{\"title\":\"Modern Brand Feeds\",\"caption\":\"Modern Brand Feeds\",\"description\":\"Desain feed media sosial dengan tampilan modern dan rapi yang menonjolkan identitas brand secara konsisten. Perpaduan warna gelap dan aksen terang digunakan untuk menciptakan visual yang kuat, profesional, dan mudah dikenali di setiap postingan.\",\"image\":\"\\/storage\\/pages\\/nAIOrRtjLlxSeCnzQRc7dxQpnYCk3aoEWA9OUNoz.png\"},{\"title\":\"Minimal Social Media Feeds\",\"caption\":\"Minimal Social Media Feeds\",\"description\":\"Feed media sosial bergaya minimalis yang fokus pada keterbacaan dan keseimbangan visual. Desain sederhana namun presisi ini membantu pesan brand tersampaikan dengan jelas tanpa mengurangi kesan elegan dan eksklusif.\",\"image\":\"\\/storage\\/pages\\/lFdOsRXmufs3XYcloJwgxDj8EaSbg8NPvoRSXI1Q.png\"},{\"title\":\"Creative Campaign Feeds\",\"caption\":\"Creative Campaign Feeds\",\"description\":\"Desain feed kreatif yang dirancang untuk kampanye dan konten promosi. Menggabungkan komposisi visual yang dinamis dengan highlight terang sebagai focal point untuk meningkatkan engagement dan daya tarik audiens.\",\"image\":\"\\/storage\\/pages\\/A8e1FTkNzXHQWcXSe9HoVStMRmTsJmh42g8EYvx6.png\"}],\"other\":[{\"title\":\"Merchandise Design\",\"caption\":\"Creative Merchandise with Strong Identity\",\"description\":\"Desain merchandise yang menggabungkan kreativitas dan identitas brand secara konsisten. Setiap visual dirancang agar tidak hanya menarik secara estetika, tetapi juga mampu memperkuat karakter brand saat diaplikasikan pada berbagai media fisik seperti apparel dan produk pendukung.\",\"image\":\"\\/storage\\/pages\\/1BfGrnSzoaQweSC2WICkv4xmZWL53qkW5zX9YjFg.png\"},{\"title\":\"High Impact Visual Advertising\",\"caption\":\"Banner & Advertising Design\",\"description\":\"Desain banner yang fokus pada penyampaian pesan secara cepat dan jelas. Menggunakan komposisi visual yang kuat, kontras gelap dan terang, serta hierarki informasi yang rapi untuk kebutuhan promosi digital maupun cetak.\",\"image\":\"\\/storage\\/pages\\/DvPG2mK46joOLcgbxyolGvFslDtMgTrOobL9kLUb.png\"},{\"title\":\"Poster & Flyer Design\",\"caption\":\"Bold Visual Communication\",\"description\":\"Poster dan flyer yang dirancang untuk menarik perhatian sekaligus menyampaikan informasi secara efektif. Perpaduan tipografi tegas, layout terstruktur, dan visual kontras menciptakan media promosi yang komunikatif, modern, dan mudah diingat.\",\"image\":\"\\/storage\\/pages\\/K7Pu6cKU2xUKP9m7swzAs9O2OwChQPNqSAjpcCR3.png\"}]}', '2025-12-23 14:57:32', '2025-12-23 16:39:00');
